// index.js or App.js
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import Dashboard from './path/to/Dashboard';

ReactDOM.render(
  <Router>
    <Dashboard />
  </Router>,
  document.getElementById('root')
);
